          <div class="col-sm">
            <div className="card text-center">
              <div className="overflow">
                <img src={male} />
              </div>
              <div className="card-body text-dark">Male</div>
            </div>
          </div>
          <div class="col-sm">
            <div className="card text-center">
              <div className="overflow">
                <img src={female} />
              </div><div className="'card-body text-dark">Female</div>
            </div>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
